-- Table structure for `hioms_group`
-- ----------------------------
DROP TABLE IF EXISTS `hioms_group`;
CREATE TABLE `hioms_group` (
  `group_id` varchar(64) NOT NULL DEFAULT '' COMMENT '部门id',
  `group_name` varchar(64) DEFAULT NULL COMMENT '部门名称',
  `group_parent_id` varchar(64) DEFAULT NULL COMMENT '父节点',
  `creator` varchar(64) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `valid` int(11) DEFAULT '1' COMMENT '是否有效 1、有效；0、无效',
  PRIMARY KEY (`group_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='group表用于存储组织架构信息,目前需要适应两层组织,分公司和中支,所以需要有个层级关系.分公司是中支机构的父节点';

