-- Records of hioms_group
-- ----------------------------

-- ----------------------------
-- Table structure for `hioms_patrol`
-- ----------------------------
DROP TABLE IF EXISTS `hioms_patrol`;
CREATE TABLE `hioms_patrol` (
  `patrol_id` varchar(64) NOT NULL DEFAULT '' COMMENT '巡查任务唯一标识',
  `treatment_number` varchar(64) DEFAULT NULL COMMENT '就诊编号',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `creator` varchar(64) DEFAULT NULL COMMENT '委派人',
  `creator_group_id` varchar(64) DEFAULT NULL COMMENT '委托人所属组织',
  `trustee_position_id` varchar(64) DEFAULT NULL COMMENT '被委派岗位',
  `status` int(11) DEFAULT NULL COMMENT '当前状态(0、未发起调查；1、待执行；2、已执行；3、已结案)',
  `nature` int(11) DEFAULT NULL COMMENT '结案定性(0、阴性；1、阳性)',
  `execute_description` varchar(255) DEFAULT NULL COMMENT '巡查结果描述',
  `description` varchar(255) DEFAULT NULL COMMENT '发起调查的原因',
  `valid` int(11) DEFAULT '1' COMMENT '是否有效(0、无效；1、有效)',
  PRIMARY KEY (`patrol_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='巡查任务表';

-- ----------------------------
-- Records of hioms_patrol
-- ----------------------------

