-- Table structure for `hioms_patrol_attachment`
-- ----------------------------
DROP TABLE IF EXISTS `hioms_patrol_attachment`;
CREATE TABLE `hioms_patrol_attachment` (
  `attachment_id` varchar(64) NOT NULL DEFAULT '' COMMENT '附件ID',
  `patrol_id` varchar(64) DEFAULT NULL COMMENT '巡查ID',
  `treatment_number` varchar(64) DEFAULT NULL COMMENT '就诊编号',
  `source` int(11) DEFAULT NULL COMMENT '附件来源(0、发起人上传；1、执行人上传)',
  `file_path` varchar(255) DEFAULT NULL COMMENT '文件路径',
  `file_name` varchar(255) DEFAULT NULL COMMENT '附件名称',
  `file_type` varchar(16) DEFAULT NULL COMMENT '附件类型(例如txt/jpg/jpeg等)',
  `valid` int(11) DEFAULT '1' COMMENT '是否有效 1、有效；0、无效；',
  PRIMARY KEY (`attachment_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

