-- Table structure for `hioms_position`
-- ----------------------------
DROP TABLE IF EXISTS `hioms_position`;
CREATE TABLE `hioms_position` (
  `position_id` varchar(64) NOT NULL DEFAULT '' COMMENT '岗位唯一标识',
  `position_name` varchar(32) DEFAULT NULL COMMENT '岗位名称',
  `group_name` varchar(64) DEFAULT NULL COMMENT '所属组织名称',
  `group_id` varchar(64) DEFAULT NULL COMMENT '所属组织',
  `valid` int(11) DEFAULT '1' COMMENT '是否有效',
  `creator` varchar(64) DEFAULT NULL COMMENT '创建者ID',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `description` varchar(128) DEFAULT NULL COMMENT '描述',
  PRIMARY KEY (`position_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='岗位表,岗位挂到组织下面,岗位下面可以挂权限,岗位可以和人关联起来,处于某个岗位的人可以看到岗位对应的权限';

